Nightmare On Main Street

On November 15, 1998, 18-year-old Miranda Fenner was murdered at a video store where she worked in Laurel, Montana. Eight years later, investigators still have no solid leads. Desperate for justice for their daughter, Miranda's parents insist that police enlist psychic aid.

